import React from 'react'
import TopNavbar from './TopNavbar'
import BottomNavbar from './BottomNavbar'

const Navbar = () => {
  return (
    <nav>
      <TopNavbar/>
      <BottomNavbar/>
    </nav>
  )
}

export default Navbar
